import React from 'react'
import {addNewMessageTextActionCreator, addMessageActionCreator} from "../../../Redux/message-reducer";
import Dialogs from "./Dialogs";

const DialogsContainer = (props) => {
console.log(props)
    let state = props.store.getState()
    console.log(state)
    let onClickHandler = () => {
        props.store.dispatch(addMessageActionCreator())
    }

    let onChangeHandler = (text) => {
        props.store.dispatch(addNewMessageTextActionCreator(text))
    }


    return (
        <div>
          <Dialogs addMessage={onClickHandler} addNewMessageText={onChangeHandler}
                   myUsers={state.profilePage.profilePage.myUsers}
                   newMessageText={state.profilePage.newMessageText}
                   allMessages={state.profilePage.profilePage.allMessages}
          />
        </div>

    )
}
export default DialogsContainer
